import React from 'react';
import pin from "../Assets/Images/pin.png";

export default function Pin() {
    return (
        <img src={pin} alt="pin" draggable={false} height={'60px'} width={'40px'} style={{position: 'fixed', bottom: -100, right: -20 }}/>
    )
}
